def remove_line(index,arr): 
    yy=[]
    for i in range(len(arr)):
        hh=[]
        for j in range(len(arr)):
            if(i==index[0] or j==index[1]):
                pass
            else:
                hh.append(arr[i][j])
        if(hh!=[]):
            yy.append(hh)
    # yy.remove([])
    return yy
 
def Adjoint_matrix(M):
    for i in range(len(M)):
        for j in range(len(M)):
            tm_list=remove_line(tuple([i,j]),M)

def 指数矩阵(x,M):
    EM = []
    for i in range(len(M)):
        hang = []
        for j in range (len(M[0])):
            if i==j:
                hang.append( exp(M[i][j]*x) )
            else:
                hang.append( 0 )
        EM.append(hang)
    return EM

def matrix_round(M,n):
    EM = []
    for i in range(len(M)):
        hang = []
        for j in range (len(M[0])):
            hang.append( round(M[i][j],n)  )
        EM.append(hang)
    return EM

def matrix_intergal(M,t,a,b):
    IM = []
    for i in range(len(M)):
        hang = []
        for j in range (len(M[0])):
            intergal = integrate(M[i][j], (t,a,b))
            hang.append( intergal  )
        IM.append(hang)
    return IM

def determinant_4(M):
    print("\n",M[0][0],determinant_3( remove_line(tuple([0,0]),M) ))
    a1 = M[0][0] * determinant_3( remove_line(tuple([0,0]),M) )
    a2 = -1*  M[0][1] * determinant_3( remove_line(tuple([0,1]),M) )
    a3 = M[0][2] * determinant_3( remove_line(tuple([0,2]),M) )
    a4 = -1* M[0][3] * determinant_3( remove_line(tuple([0,3]),M) )
    det = a1+a2+a3+a4
    return det

def determinant_3(M):
    a1 = M[0][0]*M[1][1]*M[2][2]
    a2 = M[0][1]*M[1][2]*M[2][0]
    a3 = M[0][2]*M[1][0]*M[2][1]
    b1 = M[0][2]*M[1][1]*M[2][0]
    b2 = M[1][2]*M[2][1]*M[0][0]
    b3 = M[2][2]*M[0][1]*M[1][0]
    det = a1+a2+a3-b1-b2-b3
    det = trigsimp(det)
    return det


def inverse(M):
    det = determinant_4(M)  
    for i in range(len(M)):
        for j in range(len(M[0])):
            M_ij = remove_line(tuple([i,j]),M)  
            det_M_ij  = determinant_3(M_ij)
            C_ij = (-1)**(i+1+j+1)*det_M_ij

            m_ij =  C_ij /det
            m_ij = trigsimp(m_ij)
          

